import React from 'react'
import styled from 'styled-components'
import RegionalTab from './Regional Tab/RegionalTab'

const Regional = ({CountryName}) => {
    return (
      <RegionContainer>
          <div className="Regional-tab">
               <RegionalTab Country={CountryName}/>
          </div>
          <div className="Graph-Container">
            <div className="Line">

            </div>
            <div className="Donut">

            </div>
          </div>
      </RegionContainer>
    )
}

export default Regional

const RegionContainer = styled.div`
display : flex;
width:100%;
height : 100%;
flex-direction:column;
flex-wrap:flex-wrap;
justify-content:space-between;
overflow:scroll-behavior;
& > div
{
    width:100%;
    height : fit-content;
}
.Regional-tab{
    flex:2;
    padding : 20px;

}
.Graph-Container{
    flex:1.9;
    display:flex;
    flex-direction:row;
    flex-wrap:flex-wrap;
    justify-content:space-between;
    overflow:scroll-behavior;
    & > div
    {
        width:100%;
        height : 100%;
    }
    .Line{
        flex:1.7;
        background:red;
    }
    .Donut{
        flex:2;
        background:pink;
    }
}
`
